import styled from 'styled-components';

export const Container = styled.div`

    padding: 10px 10px;
    margin-top: 15px;
    align-items: center;
    max-width: 100%;
    border-radius: 30px;
    position: relative;



h1{
    text-align: center;
    padding: 15px 0;
}
a{
    color: #000000;
}

`;

export default Container;
